export class ComplicationCrisesDouleureuse
{
    PatientId:number;
    IdCrisesDouleureuse:number;
    CrisesDouleureuse:boolean;
    Nombre:number;
    Date:string;
    Siege:string;
    ConclusionAuxUrgence:boolean;
    Hospitalisation:boolean;
    HyperhydratationPerso:boolean;
    HyperhydratationIv:boolean;
    AntalgiquesPalliersI:boolean;
    AntalgiquesPalliersIi:boolean;
    AntalgiquesPalliersIii:boolean;
    TransfusionSimple:boolean;
    EchangeTransfusionnel:boolean;

    constructor()
    {
        this.PatientId = 0;
        this.IdCrisesDouleureuse = 0;
        this.CrisesDouleureuse = false;
        this.Nombre = 0;
        this.Date = '';
        this.Siege = '';
        this.ConclusionAuxUrgence = false;
        this.Hospitalisation = false;
        this.HyperhydratationPerso = false;
        this.HyperhydratationIv = false;
        this.AntalgiquesPalliersI = false;
        this.AntalgiquesPalliersIi = false;
        this.AntalgiquesPalliersIii = false;
        this.TransfusionSimple = false;
        this.EchangeTransfusionnel = false;
    }
}
